import React, { Component } from 'react';
class Catalog extends Component {
  render() {
    const itemProduct = this.state.masive.map((masive, i) => (
      <div className="container" key={i}>
        <h1>
          <span>ComputerBOX </span>
          {masive.oglav}
        </h1>
        <div className="d-flex button_size">
          <p>{masive.text_one}</p>
          <p>{masive.text_two}</p>
        </div>
        <div className="click_svg">
          <DoorUI />
          <div className="modal_computer">
            <SVG src="../img/computer.svg" />
          </div>
        </div>
      </div>
    ));
    return (
      <div className="section_center catalog">
        <div className="container d-flex flex-row">
          <div className="col-md-4 ml-1 mr-1">
            <div className="col-md-12 mt-2 text_catalog">Фильтр</div>
          </div>
          <div className="col-md-8 ml-1 mr-1">
            <div className="col-md-12 mt-2 text_catalog">Каталог</div>
            <div className="col-md-12 container_items" />
          </div>
        </div>
      </div>
    );
  }
}
export default Catalog;
